defmodule StreamChatWeb.ChatLive.Rooms do
  import StreamChatWeb.CoreComponents
  use StreamChatWeb, :html

  def sidebar(assigns) do
    ~H"""
    <%= if @room do %>
      <aside
        id="default-sidebar"
        class="fixed top-0 left-0 z-40 w-64 h-screen transition-transform -translate-x-full sm:translate-x-0"
        aria-label="Sidebar"
        style = "background-color:#282828"
      >
      <.logo />
        <div class="h-full px-3 py-4 overflow-y-auto bg-gray-50 dark:bg-gray-800" style = "background-color:#282828">
          <.rooms_list rooms={@rooms} room={@room} live_action={@live_action} />
        </div>
      </aside>
    <% else %>
      <aside
        id="default-sidebar"
        class="fixed top-0 left-0 z-40 w-64 h-screen transition-transform -translate-x-full sm:translate-x-0"
        aria-label="Sidebar"
      >
      <.logo />
        <div class="h-full px-3 py-4 overflow-y-auto bg-gray-50 dark:bg-gray-800" style = "background-color:#282828">
          <.rooms_list rooms={@rooms} room={@room} live_action={@live_action} />
        </div>
      </aside>
      <.home_page />
    <% end %>
    """
  end

